var cutSeqNo = function(idStr) {
	var idArr = idStr.split("/");
	var idArr2 = [];
    idArr.forEach(function(e) {
		var idx = e.indexOf("#");
        if (e.indexOf("_")>(me.NumberLength1-1)) {
            idArr2.push(e.length>me.NumberLength1 ? e.substr(0,me.NumberLength1) + e.substr(idx) : e);
        } else {
            idArr2.push(e.length>me.NumberLength2 ? e.substr(0,me.NumberLength2) + e.substr(idx) : e);
        }
    });
    return idArr2.join("/");
};

