    logger.error(me.name + " ExecFlow Service: " + err);
    result += "エラーが発生しました";
}
logger.warn(me.name + " ExecFlow Service: " + exec_num + ", " + result);

var bomjson = me.GetPartList({
	number: number /* STRING [Required] */
});
// 部品情報のJSONからArrayに変換
